import {Form, Nav, Navbar, NavLink} from "react-bootstrap";
import {Bell, CircleFill, Gear, HouseDoor, SearchHeart} from "react-bootstrap-icons";
import Button from "react-bootstrap/Button";

import React, { Fragment, useState } from 'react';
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import { logout } from '../actions/auth';

const NavigationBar = ({logout, isAuthenticated}) => {

const [redirect, setRedirect] = useState(false);

const logout_user = () => {
    logout();
    setRedirect(true);
};

const guestLinks = () => (
    <Fragment>
        <li className='nav-item'>
            <Link className='nav-link' to='/login'>Login</Link>
        </li>
        <li className='nav-item'>
            <Link className='nav-link' to='/signup'>Sign Up</Link>
        </li>
    </Fragment>
);

const authLinks = () => (
    <li className='nav-item'>
        <a className='nav-link' href='#!' onClick={logout_user}>Logout</a>
    </li>
);
return(
    <Navbar collapseOnSelect expand="sm" bg="dark" variant="dark">
        <Navbar.Toggle aria-controls="navbarScroll" data-bs-toggle="collapse" data-bs-target="#navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
            <Form className="d-flex">
                <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                />
                <Button variant = "dark" ><SearchHeart /></Button>
            </Form>
            <Nav className = "ms-auto">
                <Button size = "lg" variant = "none">
                    <NavLink  eventKey="1" as={Link} to="/home">
                        <HouseDoor />
                    </NavLink>
                </Button>
                <Button size = "lg" variant = "none">
                    <NavLink  eventKey="2" as={Link} to="/notifications">
                        <Bell />
                    </NavLink>
                </Button>
                <Button size = "lg" variant = "none">
                    <NavLink  eventKey="3" as={Link} to="/settings">
                        <Gear />
                    </NavLink>
                </Button>
                <Button size = "lg" variant = "none">
                    <NavLink  eventKey="4" as={Link} to="/profile">
                        <CircleFill />
                    </NavLink>
                </Button>
            </Nav>
        </Navbar.Collapse>
    </Navbar>
);
};

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps, { logout })(Navbar);
